import React, { Component } from 'react';
import Navbar from './Navbar';
import { Container } from 'react-bootstrap'
import info_login from './Info_user';

class Home extends Component {
    render() {
        return (
            <Container fluid>
                <Navbar>
                    <info_login></info_login>
                </Navbar>
            </Container>
        );
    }
}

export default Home;
